import React from 'react';
import PropTypes from 'prop-types';
import './ParentDetails.css';
import profile from '../../images/profile.jpg';

const ParentDetails = ({ selectedParent }) => {
  return (
    <div className='header'>
      <div className="sub-header">
        <h4>Parent</h4>
        <h6>parent</h6>
        <h6>Profile</h6>
      </div>

      <div className='content-box'>
        <div className='parent-details'>
          <img src={profile} alt="Profile" />
          <div>
            <h5>Name: {selectedParent.name}</h5>
            <p>Number: {selectedParent.number}</p>
            {/* Render other details based on the selectedParent object */}
            <p>Email: {selectedParent.email}</p>
            <p>Created: {selectedParent.created}</p>
            <p>Action: {selectedParent.action}</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ParentDetails
